import Layout from '../components/layout'

function HomePage() {
  return (
    <Layout>
      <h1>Welcome to Next.js!</h1>
      <style jsx>{`
        h1 {
          background-color: blue;
          color: white;
        }
      `}</style>
      <style global jsx>{`
        body {
          background-color: yellow;
        }
      `}</style>
    </Layout>
  )
}

export default HomePage
